import React from "react";
import { Col, Row} from "react-bootstrap";

const ErrorPage = () =>{
return(
    <>
    <div className="content">
            <Row>
                <Col md={3}></Col>
                <Col md={6}>
                    <img src="404.png" alt="404 Error" />
                </Col>
                <Col md={3}></Col>
            </Row>
    </div>
    </>
)
}

export default ErrorPage;
